import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:flutter/services.dart';
import 'package:pdf_render/pdf_render.dart';
import 'package:pdf_render/pdf_render_widgets.dart';
import 'package:video_player/video_player.dart';

void main() => runApp(MyApp());

class MyApp extends StatefulWidget {
  @override
  _MyAppState createState() => _MyAppState();
}

class _MyAppState extends State<MyApp> {
  int sliderValue = 1;
  late VideoPlayerController _controller;
  PdfDocument? pdfDocument;

  @override
  void initState() {
    super.initState();
    _controller = VideoPlayerController.network(
      'https://flutter.github.io/assets-for-api-docs/assets/videos/bee.mp4',
      videoPlayerOptions: VideoPlayerOptions(mixWithOthers: true),
    );

    _controller.addListener(() {
      setState(() {});
    });
    _controller.setLooping(true);
    _controller.initialize();
    loadPdfDocument();
  }

  loadPdfDocument() async {
    var file = base64Decode(pdfBase64);

    final filea = await PdfDocument.openData(file);
    pdfDocument = filea;
    setState(() {
      //Trigger a redraw when the data is loaded
    });
  }

  FocusNode rawKeyboardListenerFocusNode = FocusNode();

  @override
  Widget build(BuildContext context) {
    print('in build');
    return MaterialApp(
      home: Scaffold(
        backgroundColor: Colors.grey,
        body: RawKeyboardListener(
          autofocus: true,
          focusNode: rawKeyboardListenerFocusNode,
          onKey: (RawKeyEvent event) {
            if (event is RawKeyDownEvent) {
              if (event.logicalKey == LogicalKeyboardKey.arrowRight && sliderValue < 4) {
                sliderValue++;
                setState(() {});
              } else if (event.logicalKey == LogicalKeyboardKey.arrowLeft && sliderValue > 1) {
                sliderValue--;
                setState(() {});
              }
            }
          },
          child: Center(
            child: pdfDocument != null
                ? Stack(
                    children: [
                      Row(
                        mainAxisAlignment: MainAxisAlignment.center,
                        children: [
                          Flexible(
                            child: PdfPageView(
                              pdfDocument: pdfDocument,
                              pageNumber: sliderValue <= 2 ? sliderValue : (sliderValue - 1) * 2,
                            ),
                          ),
                          if (sliderValue > 1)
                            Flexible(
                              child: PdfPageView(
                                pdfDocument: pdfDocument,
                                pageNumber: (sliderValue - 1) + sliderValue,
                              ),
                            ),
                        ],
                      ),
                      if (sliderValue == 3)
                        Padding(
                          padding: const EdgeInsets.all(40.0),
                          child: SizedBox(height: 300, width: 300, child: VideoPlayer(_controller)),
                        ),
                    ],
                  )
                : SizedBox(width: 300, height: 300, child: CircularProgressIndicator()),
          ),
        ),
        floatingActionButton: Column(
          mainAxisAlignment: MainAxisAlignment.end,
          children: [
            Text(sliderValue.toString()),
            Slider(
              value: sliderValue.toDouble(),
              min: 1,
              max: 4,
              label: sliderValue.toString(),
              onChanged: (double value) {
                setState(() {
                  sliderValue = value.toInt();
                });
              },
            ),
          ],
        ),
      ),
    );
  }
}

String pdfBase64 =
    '''''';
